package Arrays_Practice_JavaTPoint;

public class Array_Traverse {

	public static void main(String[] args) {
		// TODO Auto-generated method stub

		// Declaration Of Instantiation
		int arr[] = new int[10];
		
		arr[0] = 45;
		arr[1] = 78;
		arr[2] = 14;
		arr[3] = 64;
		arr[4] = 10;
		arr[5] = 33;
		arr[6] = 91;
		arr[7] = 37;
		arr[9] = 47;
		
		// Traversing array ;
		
		for(int i = 0; i < arr.length; i++) {
			
			System.out.print(arr[i]+" ");
		}
		
		
		
	}

}
